import React, {useState, useEffect} from 'react';
import Logo from './Logo'

const Navbar = () => {

  const url = `https://api.jikan.moe/v3/search/anime?q=Fate/Zero&page=1`;

  useEffect(() =>
  {
      (async function()
      {
          try
          {
              if (typeof cancelToken != typeof undefined) cancelToken.cancel("Canceling previous req");
              cancelToken = axios.CancelToken.source();
              const res = await api.get(url, {cancelToken: cancelToken.token, delay: 0});
              setAnimes(res.data.data);
              console.log(res.data);
          }
          catch(err)
          {
              console.log(err);
          }
      })();

  }, [url])
  
  return (
    <div className='navbar'>
        <Logo/>
        <div className="navbar-search-container">
          <input type="text" className="navbar-search" placeholder="Search for an anime..."/>
          <button className="navbar-search-btn" type="submit">
            <i className="fas fa-search"></i>

          </button>
        </div>

    </div>
  )
}

export default Navbar
